import './App.css';
import Logo from './componentes/logo';

const textoOpcoes = ['CATEGORIAS', 'FAVORITOS', 'MINHA ESTANTE', ''];

function App() {
  return (
    <div className='App'>
      <header className='App-header'>
        <Logo></Logo>
        <ul className='opcoes'>
          { textoOpcoes.map(function (texto){
            return <li className='opcao'><p>{texto}</p></li>
          })}
        </ul>
      </header> 
    </div>
  );
}

export default App;
